    return {
      json: {
        whatsapp: {
          "$regex": `.*${whatsapp.slice(-6)}.*`,
          "$options": "i"
        }
      }
    };
  } else if (email) {
    // Si no existe WhatsApp, utiliza el correo electr贸nico para generar el filtro
    return {
